// client/src/pages/ProblemsPage.js
import React, { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import api from "../utils/api";

const ProblemsPage = () => {
  const [problems, setProblems] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");
  const navigate = useNavigate();

  useEffect(() => {
    const fetchProblems = async () => {
      try {
        setLoading(true);
        setError("");
        // use the new endpoint that includes status
        const res = await api.get("/problems/with-status");
        setProblems(res.data || []);
      } catch (err) {
        console.error("Problems load error:", err);
        const msg =
          err?.response?.data?.message ||
          err?.response?.data?.error ||
          "Failed to load problems.";
        setError(msg);
      } finally {
        setLoading(false);
      }
    };

    fetchProblems();
  }, []);

  const goToProblem = (id) => {
    navigate(`/problems/${id}`);
  };

  const statusStyles = (status) => {
    switch (status) {
      case "Solved":
        return {
          bg: "rgba(22,163,74,0.16)",
          border: "1px solid rgba(34,197,94,0.8)",
          color: "#4ade80",
          label: "Solved",
        };
      case "Attempted":
        return {
          bg: "rgba(234,179,8,0.16)",
          border: "1px solid rgba(234,179,8,0.8)",
          color: "#facc15",
          label: "Attempted",
        };
      default:
        return {
          bg: "rgba(15,23,42,0.95)",
          border: "1px solid #1f2937",
          color: "#9ca3af",
          label: "Unsolved",
        };
    }
  };

  if (loading) {
    return (
      <div
        style={{
          minHeight: "100vh",
          padding: "32px 48px",
          background: "#020617",
          color: "#e5e7eb",
        }}
      >
        <div
          style={{
            maxWidth: 1040,
            margin: "0 auto",
            borderRadius: 24,
            padding: 24,
            border: "1px solid #111827",
            background: "#020617",
          }}
        >
          Loading problemsâ€¦
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div
        style={{
          minHeight: "100vh",
          padding: "32px 48px",
          background: "#020617",
          color: "#e5e7eb",
        }}
      >
        <div
          style={{
            maxWidth: 1040,
            margin: "0 auto",
            borderRadius: 24,
            padding: 24,
            border: "1px solid #111827",
            background: "#020617",
          }}
        >
          <p style={{ color: "#f97373" }}>{error}</p>
        </div>
      </div>
    );
  }

  return (
    <div
      style={{
        minHeight: "100vh",
        padding: "32px 48px",
        background: "#020617",
        color: "#e5e7eb",
      }}
    >
      <div
        style={{
          maxWidth: 1040,
          margin: "0 auto",
          borderRadius: 24,
          padding: 24,
          border: "1px solid #111827",
          background:
            "radial-gradient(circle at top, rgba(147,51,234,0.14), transparent 60%), #020617",
        }}
      >
        <h1
          style={{
            fontSize: 22,
            fontWeight: 700,
            marginBottom: 16,
          }}
        >
          Problems
        </h1>

        <div
          style={{
            borderRadius: 18,
            border: "1px solid #111827",
            background: "rgba(15,23,42,0.98)",
            overflow: "hidden",
          }}
        >
          <table
            style={{
              width: "100%",
              borderCollapse: "collapse",
              fontSize: 14,
            }}
          >
            <thead>
              <tr
                style={{
                  background: "#020617",
                  borderBottom: "1px solid #111827",
                }}
              >
                <th style={{ textAlign: "left", padding: "10px 14px" }}>
                  Title
                </th>
                <th style={{ textAlign: "left", padding: "10px 14px" }}>
                  Difficulty
                </th>
                <th style={{ textAlign: "left", padding: "10px 14px" }}>
                  Status
                </th>
              </tr>
            </thead>
            <tbody>
              {problems.map((p) => {
                const { bg, border, color, label } = statusStyles(p.status);

                return (
                  <tr
                    key={p._id}
                    style={{
                      borderBottom: "1px solid #020617",
                      cursor: "pointer",
                    }}
                    onClick={() => goToProblem(p._id)}
                  >
                    <td style={{ padding: "10px 14px" }}>{p.title}</td>
                    <td style={{ padding: "10px 14px" }}>
                      {p.difficulty || "-"}
                    </td>
                    <td style={{ padding: "10px 14px" }}>
                      <span
                        style={{
                          display: "inline-flex",
                          alignItems: "center",
                          gap: 6,
                          padding: "3px 10px",
                          borderRadius: 999,
                          background: bg,
                          border,
                          color,
                          fontSize: 12,
                        }}
                      >
                        <span
                          style={{
                            width: 6,
                            height: 6,
                            borderRadius: "999px",
                            background: color,
                          }}
                        />
                        {label}
                      </span>
                    </td>
                  </tr>
                );
              })}
              {problems.length === 0 && (
                <tr>
                  <td
                    colSpan={3}
                    style={{
                      padding: "12px 14px",
                      color: "#9ca3af",
                    }}
                  >
                    No problems found.
                  </td>
                </tr>
              )}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default ProblemsPage;
